import temp1 from "../img/BNAV MockUp.png";
import Grid from "@mui/material/Grid";
import Item from "@mui/material/Grid";
import Button from "@mui/material/Button";

// MUI Card
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";

import { useTheme } from "@mui/material/styles";

import Box from "@mui/material/Box";
import IconButton from "@mui/material/IconButton";
import Typography from "@mui/material/Typography";
import SkipPreviousIcon from "@mui/icons-material/SkipPrevious";
import PlayArrowIcon from "@mui/icons-material/PlayArrow";
import SkipNextIcon from "@mui/icons-material/SkipNext";

function Project() {
  const theme = useTheme();
  return (
    <Grid container spacing={4}>
      <Card style={{ backgroundColor: "rgba(355, 355, 355, 0.05)" }}>
        <Item>
          <img src={temp1} alt="" width="100%" />
        </Item>

        <Grid item xs={8}>
          <Item>
            <h3>Peak Performance App (QUT CAPSTONE Project)</h3>
            <h5> React Native • AWS • Node</h5>
            <p>
              Morbi sodales commodo neque, id fermentum ipsum dapibus ac. In eu
              ipsum elit. Sed nisl erat, vehicula eu lacus tincidunt, bibendum
              ultricies nulla. Quisque rhoncus blandit condimentum.
            </p>
            <Button variant="outlined" color="primary">
              More Info
            </Button>
          </Item>
        </Grid>
      </Card>

      <Card sx={{ display: "flex" }}>
        <Box sx={{ display: "flex", flexDirection: "column" }}>
          <CardContent sx={{ flex: "1 0 auto" }}>
            <Typography component="div" variant="h5">
              Live From Space
            </Typography>
            <Typography
              variant="subtitle1"
              color="text.secondary"
              component="div"
            >
              Mac Miller
            </Typography>
          </CardContent>
        </Box>
        <CardMedia
          component="img"
          sx={{ width: 151 }}
          image={temp1}
          alt="Live from space album cover"
        />
      </Card>
    </Grid>
  );
}

export default Project;
